import "./ExpenseItem.css";

function ExpenseItem() {
  return (
    <>
      <div className="expense-item">
        <div className="expense-item__date"> 28/3/2021 </div>
        <div>
          <h2>Car Insurance</h2>
          <div className="expense-item__amount">242</div>
        </div>
      </div>
    </>
  );
}

export default ExpenseItem;
